    "import pygame\n",
    "import sys\n",
    "import cv2\n",
    "import numpy as np\n",
    "from pygame.locals import *\n",
    "from keras.models import load_model\n",
    "\n",
    "# Constants\n",
    "WINDOWSIZEX = 280\n",
    "WINDOWSIZEY = 280\n",
    "PREDICT = True\n",
    "WHITE = (255, 255, 255)\n",
    "BLACK = (0, 0, 0)\n",
    "RED = (255, 0, 0)\n",
    "\n",
    "# Load the trained model\n",
    "MODEL = load_model(\"my_trained_model.keras\")\n",
    "\n",
    "# Initialize Pygame\n",
    "pygame.init()\n",
    "FONT = pygame.font.Font(None, 36)  # Default system font with size 36\n",
    "\n",
    "# Create the Pygame window\n",
    "DISPLAYSURF = pygame.display.set_mode((WINDOWSIZEX, WINDOWSIZEY))\n",
    "pygame.display.set_caption(\"Handwritten Digit Recognition\")\n",
    "\n",
    "# Initialize variables\n",
    "is_drawing = False\n",
    "drawing_coords = []\n",
    "\n",
    "def predict_digit(image):\n",
    "    # Resize and preprocess the image for prediction\n",
    "    image_resized = cv2.resize(image, (28, 28))\n",
    "    image_resized = image_resized.astype('float32') / 255.0\n",
    "    image_processed = np.expand_dims(image_resized, axis=0)\n",
    "\n",
    "    # Predict the digit using the model\n",
    "    prediction = MODEL.predict(image_processed)\n",
    "    predicted_label = np.argmax(prediction)\n",
    "\n",
    "    return predicted_label\n",
    "\n",
    "# Main loop\n",
    "while True:\n",
    "    for event in pygame.event.get():\n",
    "        if event.type == QUIT:\n",
    "            pygame.quit()\n",
    "            sys.exit()\n",
    "\n",
    "        elif event.type == MOUSEBUTTONDOWN:\n",
    "            is_drawing = True\n",
    "            drawing_coords = []\n",
    "\n",
    "        elif event.type == MOUSEMOTION and is_drawing:\n",
    "            x, y = event.pos\n",
    "            pygame.draw.circle(DISPLAYSURF, WHITE, (x, y), 8)\n",
    "            drawing_coords.append((x, y))\n",
    "\n",
    "        elif event.type == MOUSEBUTTONUP:\n",
    "            is_drawing = False\n",
    "\n",
    "            if drawing_coords:\n",
    "                # Create a blank surface for the digit\n",
    "                digit_surf = pygame.Surface((280, 280))\n",
    "                digit_surf.fill(BLACK)\n",
    "\n",
    "                # Draw the lines on the surface\n",
    "                for i in range(1, len(drawing_coords)):\n",
    "                    pygame.draw.line(digit_surf, WHITE, drawing_coords[i - 1], drawing_coords[i], 16)\n",
    "\n",
    "                # Convert to numpy array\n",
    "                img_arr = pygame.surfarray.array3d(digit_surf)\n",
    "                img_arr = cv2.cvtColor(img_arr, cv2.COLOR_RGB2GRAY)  # Convert to grayscale\n",
    "\n",
    "                # Predict the digit\n",
    "                predicted_digit = predict_digit(img_arr)\n",
    "\n",
    "                # Display prediction result\n",
    "                text_surface = FONT.render(f\"Predicted Digit: {predicted_digit}\", True, RED)\n",
    "                text_rect = text_surface.get_rect(center=(WINDOWSIZEX // 2, 30))\n",
    "                DISPLAYSURF.blit(text_surface, text_rect)\n",
    "\n",
    "                # Clear the drawing coords\n",
    "                drawing_coords = []\n",
    "\n",
    "        elif event.type == KEYDOWN:\n",
    "            if event.key == K_c:  # Clear the screen on 'c' key press\n",
    "                DISPLAYSURF.fill(BLACK)\n",
    "                pygame.display.update()\n",
    "\n",
    "    pygame.display.update()\n"
